  protected TomList concat(TomList l1, TomList l2) {
    if(l1.isEmpty()) {
	    return l2;
    } else {
	    return cons(l1.getHead(), concat(l1.getTail(),l2));
    }
  }

  protected TomList reverse(TomList l) {
    TomList reverse = empty();
    while(!l.isEmpty()){
	    reverse = cons(l.getHead(),reverse);
	    l = l.getTail();
    }
    return reverse;
  }

